(1, '65396194b2c46', 68, 4, '2022-10-23', 'AC', 'Brasiléia', 'Mata Atlântica', '2222', '222', '', '222', '222', '', '22', 'BR230PA_Lic.zip', '', '222', '2023-10-25 18:42:28', '2023-10-25 18:42:28', NULL, 'F:\\Apache24_8081\\htdocs\\DPP\\ecosistema\\writable\\\\uploads\\shape_file\\653961949b000.json'),
(2, '65450147ae0b2', 68, 5, '2023-11-03', 'AC', 'Assis Brasil', 'Cerrado', '123', '123', '', '123', '123', '', '123', 'BR_307_364_AM_AC.zip', '', '123', '2023-11-03 14:18:47', '2023-11-03 14:18:47', NULL, 'F:\\Apache24_8081\\htdocs\\DPP\\ecosistema\\writable\\\\uploads\\shape_file\\654501479da75.json'),
(3, '66017fd04e474', 124, 1, '2023-09-11', 'RS', 'São José dos Ausentes', 'Mata Atlântica', '-28,7615', '-50,0127', '', '-28,7615', '-50,0127', '', 'Estepe (Campos do Sul do Brasil) - gramíneo lenhosa (campestre) com floresta de galeria', 'Pontos_1.zip', '', 'Ponto amostral 1 - Coleta no rio Manoel Leão de 1ª ordem. Vegetação predominantemente convertida em pastagem, leito formado por lama. Rio barrado para utilização como bebedouro (açude) para animais de criação. Portanto, com presença de gado no leito e açude.', '2024-03-25 10:44:48', '2024-03-25 15:56:58', NULL, 'F:\\Apache24_8081\\htdocs\\DPP\\ecosistema\\writable\\\\uploads\\shape_file\\66017fd04cb39.json'),
(4, '6601851272ad1', 124, 1, '2023-09-11', 'RS', 'São José dos Ausentes', 'Mata Atlântica', '-28,7576', '-50,016', '', '-28,757', '-50,016', '', 'Estepe (Campos do Sul do Brasil) - gramíneo lenhosa (campestre) com floresta de galeria', 'Pontos_2.zip', '', 'Ponto amostral 2 - Coleta no rio Manoel Leão de 2ª ordem. Vegetação arbustiva. Leito retilinizado e canalizado como passagem de fauna da rodovia. Fundo lamoso quando fora da área canalizada.', '2024-03-25 11:07:14', '2024-03-25 15:57:06', NULL, 'F:\\Apache24_8081\\htdocs\\DPP\\ecosistema\\writable\\\\uploads\\shape_file\\6601851271179.json'),
(5, '66018fee97537', 124, 1, '2023-09-11', 'RS', 'São José dos Ausentes', 'Mata Atlântica', '-28,756', '-50,0181', '', '-28,756', '-50,0181', '', 'Estepe (Campos do Sul do Brasil) - gramíneo lenhosa (campestre) com floresta de galeria', 'Pontos_3.zip', '', 'Ponto amostral 3 - coleta no rio Manoel Leão de 1ª ordem. Vegetação campestre, com presença de arbustos e pontos convertidos em pastagem. Leito estreito com fundo arenoso e margens alagáveis. Presença de talhões de pinus a poucos metros das margens.', '2024-03-25 11:53:34', '2024-03-25 15:57:15', NULL, 'F:\\Apache24_8081\\htdocs\\DPP\\ecosistema\\writable\\\\uploads\\shape_file\\66018fee950ca.json'),
(6, '6601ac4fd4ff9', 124, 1, '2023-09-11', 'RS', 'São José dos Ausentes', 'Mata Atlântica', '-28,7443', '-50,0332', '', '-28,7443', '-50,0332', '', 'Estepe (Campos do Sul do Brasil) - gramíneo lenhosa (campestre) com floresta de galeria', 'Pontos_4.zip', '', 'Ponto amostral 4 - Coleta no rio Manoel Leão, de 1ª ordem. Vegetação característica de banhado, com arbustos e gravatás. Fundo predominantemente arenoso e lamoso, com presença abundante de macrófitas, formando um tapete de vegetação. Sem lâmina de água visível, inviabilizando o monitoramento. Margens alagáveis e presença de gado nas proximidades.', '2024-03-25 13:54:39', '2024-03-25 15:57:24', NULL, 'F:\\Apache24_8081\\htdocs\\DPP\\ecosistema\\writable\\\\uploads\\shape_file\\6601ac4fd3c18.json'),
(7, '6601accb73b9d', 124, 1, '2023-09-11', 'RS', 'São José dos Ausentes', 'Mata Atlântica', '-28,7514', '-50,0385', '', '-28,7514', '-50,0385', '', 'Estepe (Campos do Sul do Brasil) - gramíneo lenhosa (campestre) com floresta de galeria', 'Pontos_5.zip', '', 'Ponto amostral 5 - coleta no rio Manoel Leão, de 1ª ordem. Fisionomia campestre, com vegetação arbustiva, gramíneas e pinus. Canalizado sob estrada. Leito estreito, fundo lamoso e margens erodidas.', '2024-03-25 13:56:43', '2024-03-25 15:57:35', NULL, 'F:\\Apache24_8081\\htdocs\\DPP\\ecosistema\\writable\\\\uploads\\shape_file\\6601accb725d2.json'),
(8, '6601ad38d8f09', 124, 1, '2023-09-11', 'RS', 'São José dos Ausentes', 'Mata Atlântica', '-28,7644', '-49,9984', '', '-28,7644', '-49,9984', '', 'Estepe (Campos do Sul do Brasil) - gramíneo lenhosa (campestre) com floresta de galeria', 'Pontos_6.zip', '', 'Ponto amostral 6 - coleta no rio Manoel Leão. Vegetação característica de banhado, com arbustos e gravatás. Sem conectividade aparente com outros rios.', '2024-03-25 13:58:32', '2024-03-25 15:57:49', NULL, 'F:\\Apache24_8081\\htdocs\\DPP\\ecosistema\\writable\\\\uploads\\shape_file\\6601ad38d81cb.json'),
(9, '6601ad8dc7d8b', 124, 1, '2023-09-11', 'RS', 'São José dos Ausentes', 'Mata Atlântica', '-28,7726', '-50,0074', '', '-28,7726', '-50,0074', '', 'Estepe (Campos do Sul do Brasil) - gramíneo lenhosa (campestre) com floresta de galeria', 'Pontos_7.zip', '', 'Ponto amostral 7 - coleta no rio das Antas de 2ª ordem. Vegetação campestre, com gramíneas e arbustos. Fundo lamoso, leito estreito e margens alagáveis. Profundo em período chuvoso, alcançando aprox. 1m.', '2024-03-25 13:59:57', '2024-03-25 15:57:59', NULL, 'F:\\Apache24_8081\\htdocs\\DPP\\ecosistema\\writable\\\\uploads\\shape_file\\6601ad8dc585e.json'),
(10, '6601af34749b5', 124, 1, '2023-09-11', 'RS', 'São José dos Ausentes', 'Mata Atlântica', '-28,7769', '-50,0052', '', '-28,7769', '-50,0052', '', 'Estepe (Campos do Sul do Brasil) - gramíneo lenhosa (campestre) com floresta de galeria', 'Pontos_8.zip', '', 'Ponto amostral 8 - coleta no rio das Antas de 2ª ordem. Fisionomia campestre, com vegetação composta por gramíneas nas margens e submersas. Fundo com seixo rolado. Leito estreito e margens alagáveis.', '2024-03-25 14:07:00', '2024-03-25 15:58:07', NULL, 'F:\\Apache24_8081\\htdocs\\DPP\\ecosistema\\writable\\\\uploads\\shape_file\\6601af347249a.json'),
(11, '6601af9013741', 124, 1, '2023-09-11', 'RS', 'São José dos Ausentes', 'Mata Atlântica', '-28,7812', '-49,9956', '', '-28,7812', '-49,9956', '', 'Estepe (Campos do Sul do Brasil) - gramíneo lenhosa (campestre) com floresta de galeria', 'Pontos_9.zip', '', 'Ponto amostral 9 - coleta no rio das Antas de 1ª ordem. Fisionomia campestre, vegetação marginal composta por gramíneas e árvores pequenas. Fundo com seixo rolado e cascalho. Leito estreito, com passagem molhada de veículos.', '2024-03-25 14:08:32', '2024-03-25 15:58:14', NULL, 'F:\\Apache24_8081\\htdocs\\DPP\\ecosistema\\writable\\\\uploads\\shape_file\\6601af9010881.json'),
(13, '6601b270dd0e2', 124, 1, '2023-09-11', 'RS', 'São José dos Ausentes', 'Mata Atlântica', '-28,7802', '-49,9804', '', '-28,7802', '-49,9804', '', 'Estepe (Campos do Sul do Brasil) - gramíneo lenhosa (campestre) com floresta de galeria', 'Pontos_10.zip', '', 'Ponto amostral 10 - coleta no rio das Antas de 4ª ordem. Vegetação marginal composta por gramíneas e mata de araucárias. Leito composto por laje e seixos. Presença de gado na margem esquerda. Leito superando 3m de largura.', '2024-03-25 14:20:48', '2024-03-25 15:58:25', NULL, 'F:\\Apache24_8081\\htdocs\\DPP\\ecosistema\\writable\\\\uploads\\shape_file\\6601b270dbd22.json'),
(14, '6601b4352679e', 124, 1, '2023-09-11', 'RS', 'São José dos Ausentes', 'Mata Atlântica', '-28,7807', '-49,9813', '', '-28,7807', '-49,9813', '', 'Estepe (Campos do Sul do Brasil) - gramíneo lenhosa (campestre) com floresta de galeria', 'Pontos_11.zip', '', 'Ponto amostral 11 - coleta no rio das Antas de 4ª ordem. Vegetação marginal composta por gramíneas e mata de araucárias. Leito composto por laje e seixos. Presença de gado na margem esquerda. Leito superando 3m de largura.', '2024-03-25 14:28:21', '2024-03-25 15:58:33', NULL, 'F:\\Apache24_8081\\htdocs\\DPP\\ecosistema\\writable\\\\uploads\\shape_file\\6601b43523b25.json'),
(15, '6601b49687060', 124, 1, '2023-09-11', 'RS', 'São José dos Ausentes', 'Mata Atlântica', '-28,7833', '-49,9831', '', '-28,7833', '-49,9831', '', 'Estepe (Campos do Sul do Brasil) - gramíneo lenhosa (campestre) com floresta de galeria', 'Pontos_12.zip', '', 'Ponto amostral 12 - coleta no rio das Antas de 4ª ordem. Vegetação marginal composta por gramíneas e área convertida em pastagem. Leito composto por seixo rolado. Presença de gado e ovino na margem esquerda e, aparentemente, direita e leito. Leito superando 3m de largura.', '2024-03-25 14:29:58', '2024-03-25 15:58:43', NULL, 'F:\\Apache24_8081\\htdocs\\DPP\\ecosistema\\writable\\\\uploads\\shape_file\\6601b49685a3d.json'),
(16, '6601b4f2ec2f7', 124, 1, '2023-09-11', 'RS', 'São José dos Ausentes', 'Mata Atlântica', '-28,771316', '-49,986106', '', '-28,771316', '-49,986106', '', 'Estepe (Campos do Sul do Brasil) - gramíneo lenhosa (campestre) com floresta de galeria', 'Pontos_13.zip', '', 'Ponto amostral 13 - coleta no rio das Antas de 2ª ordem. Margem direita com vegetação campestre e margem esquerda com vegetação predominantemente arbórea e arbustiva. Leito estreito constituído por laje rochosa, lâmina d\'água rasa e baixa velocidade. O ponto se localiza a jusante do traçado da rodovia.', '2024-03-25 14:31:30', '2024-03-25 15:58:50', NULL, 'F:\\Apache24_8081\\htdocs\\DPP\\ecosistema\\writable\\\\uploads\\shape_file\\6601b4f2e9252.json'),
(17, '6601b55d18962', 124, 1, '2023-09-11', 'RS', 'São José dos Ausentes', 'Mata Atlântica', '-28,785277', '-49,968025', '', '-28,785277', '-49,968025', '', 'Estepe (Campos do Sul do Brasil) - gramíneo lenhosa (campestre) com floresta de galeria', 'Pontos_14.zip', '', 'Ponto amostral 14 - coleta no rio das Antas de 3ª ordem. Fisionomia campestre, com vegetação constituída por gramíneas em ambas as margens. Leito estreito, laje rochosa, com presença abundante de macrófitas aquáticas. Lâmina d\'água rasa e baixa velocidade. Ponto localizado a montante do traçado da rodovia.', '2024-03-25 14:33:17', '2024-03-25 15:59:00', NULL, 'F:\\Apache24_8081\\htdocs\\DPP\\ecosistema\\writable\\\\uploads\\shape_file\\6601b55d17451.json'),
(18, '6601b5d6e5726', 124, 1, '2023-09-11', 'RS', 'São José dos Ausentes', 'Mata Atlântica', '-28,785205', '-49,973446', '', '-28,785205', '-49,973446', '', 'Estepe (Campos do Sul do Brasil) - gramíneo lenhosa (campestre) com floresta de galeria', 'Pontos_15.zip', '', 'Ponto amostral 15 - coleta no rio das Antas de 3ª ordem. Fisionomia campestre, com vegetação constituída majoritariamente por gramíneas e fragmento arbustivo na margem direita. Leito estreito formado por laje rochosa e matacões, com presença de macrófitas. Lâmina d\'água rasa e baixa velocidade. Ponto localizado a jusante do traçado da rodovia.', '2024-03-25 14:35:18', '2024-03-25 15:59:09', NULL, 'F:\\Apache24_8081\\htdocs\\DPP\\ecosistema\\writable\\\\uploads\\shape_file\\6601b5d6e27fa.json'),
