(25, '6601c827e10f3', 124, 1, '2023-09-11', 'RS', 'São José dos Ausentes', 'Mata Atlântica', '-28,7885', '-49,983', '', '-28,7885', '-49,983', '', 'Estepe (Campos do Sul do Brasil) - gramíneo lenhosa (campestre) com floresta de galeria', 'Pontos_17.zip', '', 'Ponto amostral 17 - coleta no rio das Antas de 3ª ordem. Fisionomia campestre, formada por gramíneas e arbustos. Leito com aprox. 3m e presença de ponte. Fundo formado por laje, com presença de líquens nas partes mais expostas. Algumas gramíneas presentes no leito.', '2024-03-25 15:53:27', '2024-03-25 15:59:24', NULL, 'F:\\Apache24_8081\\htdocs\\DPP\\ecosistema\\writable\\\\uploads\\shape_file\\6601c827daf25.json'),
(26, '6601c8ead5233', 124, 1, '2023-09-11', 'RS', 'São José dos Ausentes', 'Mata Atlântica', '-28,7922', '-49,98', '', '-28,7922', '-49,98', '', 'Estepe (Campos do Sul do Brasil) - gramíneo lenhosa (campestre) com floresta de galeria', 'Pontos_18.zip', '', 'Ponto amostral 18 - coleta no rio das Antas de 2ª ordem. Vegetação campestre, gramíneas com alguns arbustos. Fundo formado por laje e seixos, com presença de gramíneas no leito. Leito de 2 a 3m de largura.', '2024-03-25 15:56:42', '2024-03-25 15:59:34', NULL, 'F:\\Apache24_8081\\htdocs\\DPP\\ecosistema\\writable\\\\uploads\\shape_file\\6601c8ead3d11.json'),
(27, '6601ca765a886', 124, 1, '2023-09-11', 'RS', 'São José dos Ausentes', 'Mata Atlântica', '-28,773876', '-49,977021', '', '-28,773876', '-49,977021', '', 'Estepe (Campos do Sul do Brasil) - gramíneo lenhosa (campestre) com floresta de galeria', 'Pontos_19.zip', '', 'Ponto amostral 19 - coleta no rio das Antas de 2ª ordem, sendo seu entorno caracterizado principalmente por campo com uso na pecuária, apesar de apresentar considerável mata marginal. Apresenta média velocidade da água e o leito do rio constituído predominantemente de seixo rolado e matacão.', '2024-03-25 16:03:18', '2024-03-25 16:03:18', NULL, 'F:\\Apache24_8081\\htdocs\\DPP\\ecosistema\\writable\\\\uploads\\shape_file\\6601ca7657ec3.json'),
(28, '6601cad7e5899', 124, 1, '2023-09-11', 'RS', 'São José dos Ausentes', 'Mata Atlântica', '-28,7741', '-49,9776', '', '-28,7741', '-49,9776', '', 'Estepe (Campos do Sul do Brasil) - gramíneo lenhosa (campestre) com floresta de galeria', 'Pontos_20.zip', '', 'Ponto amostral 20 - coleta no rio das Antas de 3ª ordem. Vegetação marginal arbustiva e arbórea, com gramíneas no entorno, próximo a floresta de araucárias. Presença de gado. Fundo formado por laje e seixos. Leito com aprox. 3m de largura.', '2024-03-25 16:04:55', '2024-03-25 16:04:55', NULL, 'F:\\Apache24_8081\\htdocs\\DPP\\ecosistema\\writable\\\\uploads\\shape_file\\6601cad7e1b5f.json'),
(29, '6601cb2f4f6dd', 124, 1, '2023-09-11', 'RS', 'São José dos Ausentes', 'Mata Atlântica', '-28,774885', '-49,979736', '', '-28,774885', '-49,979736', '', 'Estepe (Campos do Sul do Brasil) - gramíneo lenhosa (campestre) com floresta de galeria', 'Pontos_21.zip', '', 'Ponto amostral 21 - coleta no rio das Antas de 3ª ordem, com vegetação marginal constituída principalmente de vegetação arbórea associada com araucárias. Leito predominantemente de seixo rolado. Entorno caracterizado por campo com uso na pecuária. No local há um pequeno lago decorrente da cachoeira em sua proximidade.', '2024-03-25 16:06:23', '2024-03-25 16:06:23', NULL, 'F:\\Apache24_8081\\htdocs\\DPP\\ecosistema\\writable\\\\uploads\\shape_file\\6601cb2f4d837.json'),
(30, '6601cb911423d', 124, 1, '2023-09-11', 'RS', 'São José dos Ausentes', 'Mata Atlântica', '-28,777021', '-49,978944', '', '-28,777021', '-49,978944', '', 'Estepe (Campos do Sul do Brasil) - gramíneo lenhosa (campestre) com floresta de galeria', 'Pontos_22.zip', '', 'Ponto amostral 22 - coleta no rio das Antas de 4ª ordem, com vegetação marginal constituída principalmente de vegetação arbórea associada com araucárias. Leito predominantemente de seixo rolado e matacão. Entorno de campo com uso na pecuária. Caracteriza-se como um rio largo de média velocidade da água.', '2024-03-25 16:08:01', '2024-03-25 16:08:01', NULL, 'F:\\Apache24_8081\\htdocs\\DPP\\ecosistema\\writable\\\\uploads\\shape_file\\6601cb91110cc.json'),
(31, '6601cbe9020ad', 124, 1, '2023-09-11', 'RS', 'São José dos Ausentes', 'Mata Atlântica', '-28,7947', '-49,9792', '', '-28,7947', '-49,9792', '', 'Estepe (Campos do Sul do Brasil) - gramíneo lenhosa (campestre) com floresta de galeria', 'Pontos_23.zip', '', 'Ponto amostral 23 - coleta no rio das Antas de 1ª ordem. Margens com vegetação de gramíneas e alguns arbustos. Fundo com laje, lama e gramíneas submersas. Leito com largura inferior a 1m.', '2024-03-25 16:09:29', '2024-03-25 16:09:29', NULL, 'F:\\Apache24_8081\\htdocs\\DPP\\ecosistema\\writable\\\\uploads\\shape_file\\6601cbe8f3a16.json');
