(2, 129, 5, 2, 'RELATÓRIO TESTE 01', '', '', '', '2024-03-08 10:54:27', '2024-03-08 11:30:19', NULL),
(3, 129, 5, 1, 'TESTE CONCLUSÃO', '', 'CONCLUSÃO', '', '2024-03-08 14:28:14', '2024-03-08 14:28:56', NULL),
(4, 126, 12, 1, 'Relatório Específico de Execução de Programas - Programa de Monitoramento dos Impactos Ambientais dos Recursos Hídricos Superficiais - CAMPANHA 21 - set/23', '', 'A 21ª campanha do Programa de Monitoramentos dos Impactos Ambientais dos Recursos Hídricos Superficiais, indicou que o Rio Jundiaí tem apresentado diminuição na qualidade da água. Apesar disso, a qualidade das águas de ambos os rios foi classificada como ruim, de acordo com o Índice de Qualidade das águas (IQA). Porém, ao avaliar os parâmetros físico-químicos e microbiológicos dos referidos cursos hídricos com a campanha background, verificou-se que diferentes fatores contribuem para este resultado, como a sazonalidade, presença e/ou ausência de vegetação nas margens dos rios e processos erosivos, além da localização dos mesmos.', '', '2024-04-24 16:03:03', '2024-04-24 16:14:07', NULL),
(5, 126, 13, 1, 'Relatório Específico de Execução de Programas - Programa de Monitoramento dos Impactos Ambientais dos Recursos Hídricos Superficiais - CAMPANHA 22 - jan/24', '', 'A 22ª campanha do Programa de Monitoramentos dos Impactos Ambientais dos Recursos Hídricos Superficiais, indicou que o Rio Jundiaí tem apresentado diminuição na qualidade da água. Apesar disso, a qualidade das águas de ambos os rios foi classificada como ruim, de acordo com o Índice de Qualidade das águas (IQA). Porém, ao avaliar os parâmetros físico-químicos e microbiológicos dos referidos cursos hídricos com a campanha background, verificou-se que diferentes fatores contribuem para este resultado, como a sazonalidade, presença e/ou ausência de vegetação nas margens dos rios e processos erosivos, além da localização dos mesmos.', '', '2024-04-24 16:04:11', '2024-04-24 16:11:15', NULL),
(6, 143, 14, 2, 'RA 82 – Relatório do Programa de Monitoramento da Qualidade de Água', ' PMQA referente à 24ª Campanha de dezembro de 2023. ', 'De acordo com os resultados da 24ª campanha de amostragem do PMQA pode-se concluir que:\n(1) Com base no Índices de Qualidade da Água (IQA-NSF) a classificação da qualidade das águas dos corpos hídricos monitorados foi “Boa” em apenas um dos pontos amostrados e “razoável” nos demais. Todos dos pontos foram classificados como mesotróficos, segundo o Índice do Estado Trófico (IET).\n(2) Com relação à Resolução CONAMA 357/2005, o córrego Trubial não atendeu ao parâmetro de cor. Já os rios Areial, São Lourenço e Aricá-Açu, não atenderam aos parâmetros de cor e turbidez. Considerando que não havia obras nesses locais, a hipótese mais provável é que a alteração da qualidade da água tenha dado em função das chuvas ocorridas na região na véspera da amostragem.\n(3) De acordo com os resultados apresentados não se evidenciou alterações na qualidade da água causadas diretamente pelo desenvolvimento das obras na BR 163/364-MT.\n(4) A qualidade da água dos corpos hídricos monitorados à montante e à jusante da rodovia, dentro da faixa de domínio, é praticamente a mesma, considerando o intervalo de classes da classificação do IQA-NSF.\nDestaca-se ainda que, a interpretação dos resultados foi realizada de forma global e sinérgica, considerando a relação entre os parâmetros, a obra, o clima da região e as características das bacias hidrográficas.', '', '2024-05-20 18:52:03', '2024-05-20 19:01:35', NULL),
(7, 70, 1, 1, '1', '', '', '', '2024-05-28 11:43:56', '2024-05-28 11:43:56', NULL),
(8, 115, 16, 3, '41ª Campanha PMQA - março/2024', '', 'Como pode ser observado no gráfico do IQA, a maioria dos pontos monitorados possui água com qualidade de média a boa, com nenhum ponto inferior a média qualidade. Observa-se que os pontos com maior variação dos parâmetros encontram-se nas margens do Rio Araguaia com influência direta da zona urbana, que com as contribuições de esgoto e atividades diversas, elevam parâmetros como coliformes, DBO/DQO, nitrogênio e fósforo.', 'aprovo relatorio', '2024-05-28 17:30:45', '2024-05-29 14:47:55', NULL),
(9, 115, 16, 3, '40ª Campanha PMQA - Novembro/2023', '', 'Como pode ser observado no gráfico do IQA, a maioria dos pontos monitorados possui água com qualidade de média a boa, com nenhum ponto inferior a média qualidade. Observa-se que os pontos com maior variação dos parâmetros encontram-se nas margens do Rio Araguaia com influência direta da zona urbana, que com os contribuintes de esgoto e atividades diversas, elevam parâmetros como coliformes, DBO/DQO, nitrogênio e fósforo. ', 'aprovo relatorio', '2024-05-28 17:54:54', '2024-05-29 14:48:05', NULL),
(10, 126, 18, 1, 'Relatório Específico de Execução de Programas - Programa de Monitoramento dos Impactos Ambientais dos Recursos Hídricos Superficiais - CAMPANHA 23 - mai/24', '', 'Na 23ª campanha do Programa de Monitoramentos dos Impactos Ambientais dos Recursos Hídricos Superficiais, observou-se que o Rio Jundiaí tem apresentado diminuição na qualidade da água. A qualidade das águas de ambos os rios foi classificada como ruim, de acordo com o IQA. Porém, ao avaliar os parâmetros físico-químicos e microbiológicos dos referidos cursos hídricos comparando com a campanha background, verificou-se que diferentes fatores têm contribuído para este resultado, como a sazonalidade, presença e/ou ausência de vegetação nas margens dos rios e indicativos de lançamento de esgoto.', '', '2024-05-29 11:24:54', '2024-05-29 11:32:36', NULL),
(14, 251, 19, 1, 'Relatorio campanha 11', '', 'Nos Rios Curuçá (ponto 01A) e Autaz Mirim (ponto 01B), houve colapso das pontes. Atualmente em ambos os casos, estão sendo utilizadas balsas.\nNestes pontos serão coletadas amostras em todas as campanhas até que sejam construídas as novas pontes.\nOs pontos 01B2, 01C, 05 e 09, encontravam-se seco ou sem fluxo. Sendo assim, não foi possível coletar amostras nesses cursos hídricos.\nNo presente relatório comparativamente com o relatório de fevereiro/24, notamos uma tendência de aumento nos valores do pH de todas as amostras, bem como, da concentração oxigênio dissolvido (OD) o que pode ser explicado pelo aumento da concentração dos compostos coloridos e da temperatura. Estes fenômenos são de ordem sazonal e não implicam em efeitos de impactos ambientais.\nConsiderando os resultados das análises das amostras coletadas ao longo da BR-319, pode-se afirmar que não há evidências de que as atividades de construção e/ou manutenção da rodovia estejam afetando a qualidade da água superficial.\nSendo assim, estes recursos hídricos podem ser utilizados para as seguintes atividades previstas na Resolução do CONAMA 357/2005 para águas de classe I e II descritos a seguir:\na)	ao abastecimento para consumo humano, após tratamento simplificado;\nb)	à proteção das comunidades aquáticas;\nc)	à recreação de contato primário, tais como natação, esqui aquático e mergulho, conforme Resolução CONAMA nº 274, de 2000;\nd)	à irrigação de hortaliças que são consumidas cruas e de frutas que se desenvolvam rentes ao solo e que sejam ingeridas cruas sem remoção de película; e\ne)	à proteção das comunidades aquáticas em Terras Indígenas.\n', '', '2024-06-06 09:40:59', '2024-06-06 09:48:37', NULL),
(15, 251, 21, 1, 'Relatório campanha 10', '', 'Nos Rios Curuçá (ponto 01A) e Autaz Mirim (ponto 01B), houve colapso das pontes. Atualmente em ambos os casos, estão sendo utilizadas balsas.\nNestes pontos serão coletadas amostras em todas as campanhas até que sejam construídas as novas pontes.\nOs pontos 01B2, 01C, 05, 09 e 21, encontravam-se seco ou sem fluxo. Esta situação é comum na época de vazante dos rios no qual os rios amazônicos diminuem significativamente seu nível de água. Sendo assim, não foi possível coletar amostras nesses cursos hídricos.\nNo presente relatório comparativamente com o relatório de dezembro/23, notamos uma tendência de redução nos valores do pH de todas as amostras, bem como, da concentração oxigênio dissolvido (OD) o que pode ser explicado pelo aumento da concentração dos compostos coloridos e da temperatura.  Estes fenômenos são de ordem sazonal e não implicam em efeitos de impactos ambientais.\nConsiderando os resultados das análises das amostras coletadas ao longo da BR-319, pode-se afirmar que não há evidências de que as atividades de construção e/ou manutenção da rodovia estejam afetando a qualidade da água superficial.\nSendo assim, estes recursos hídricos podem ser utilizados para as seguintes atividades previstas na Resolução do CONAMA 357/2005 para águas de classe I e II descritos a seguir:\na)	ao abastecimento para consumo humano, após tratamento simplificado;\nb)	à proteção das comunidades aquáticas;\nc)	à recreação de contato primário, tais como natação, esqui aquático e mergulho, conforme Resolução CONAMA nº 274, de 2000;\nd)	à irrigação de hortaliças que são consumidas cruas e de frutas que se desenvolvam rentes ao solo e que sejam ingeridas cruas sem remoção de película; e\ne)	à proteção das comunidades aquáticas em Terras Indígenas.\n', '', '2024-06-06 09:49:43', '2024-06-06 10:29:59', NULL),
(17, 251, 24, 1, 'Relatório campanha 7', '', 'Os pontos 01C, 03B, 05, 09, 18, 19, 20, 21, 22, 22A, 27B, 30, 31, 32, 41, 43, 43c, 45, 50, 51 e 60 encontravam-se seco ou sem fluxo. Esta situação é comum na época de vazante dos rios no qual os rios amazônicos diminuem significativamente seu nível de água. Sendo assim, não foi possível coletar amostras nesses cursos hídricos.\nNos Rios Curuçá (ponto 01A) e Autaz Mirim (ponto 01B), houve colapso das pontes. Atualmente em ambos os casos, estão sendo utilizadas balsas.\nNestes pontos serão coletadas amostras em todas as campanhas até que sejam construídas as novas pontes.\nDesde a 6ª Campanha (junho) as amostras já apresentam influência do período da vazante, tais como: existe menor influência das águas do Rio Madeira; a concentração da cor da água preta está mais baixa, em decorrência da diminuição da precipitação de chuva; A temperatura da água está mais alta e os valores da DBO e DQO estão mais estáveis, indicando menores influências externas.\nNo presente relatório comparativamente com o relatório de junho/23, notou-se uma tendência de redução nos valores do pH de todas as amostras, bem como, da concentração oxigênio dissolvido (OD) o que pode ser explicado pelo aumento da concentração dos compostos coloridos e da temperatura. Estes fenômenos são de ordem sazonal e não implicam em efeitos de impactos ambientais.\nConsiderando os resultados das análises das amostras coletadas nos 60 cursos hídricos ao longo da BR-319, pode-se afirmar que não há evidências de que as atividades de construção e/ou manutenção da rodovia estejam afetando a qualidade da água superficial.\nSendo assim, estes recursos hídricos podem ser utilizados para as seguintes atividades previstas na Resolução do CONAMA 357/2005 para águas de classe II descritos a seguir:\na)	ao abastecimento para consumo humano, após tratamento simplificado;\nb)	à proteção das comunidades aquáticas;\nc)	à recreação de contato primário, tais como natação, esqui aquático e mergulho, conforme Resolução CONAMA nº 274, de 2000;\nd)	à irrigação de hortaliças que são consumidas cruas e de frutas que se desenvolvam rentes ao solo e que sejam ingeridas cruas sem remoção de película; e\ne)	à proteção das comunidades aquáticas em Terras Indígenas.\n', '', '2024-06-06 10:15:52', '2024-06-06 10:25:57', NULL),
(18, 251, 23, 1, 'Relatório campanha 8', '', 'Nos Rios Curuçá (ponto 01A) e Autaz Mirim (ponto 01B), houve colapso das pontes. Atualmente em ambos os casos, estão sendo utilizadas balsas.\nNestes pontos serão coletadas amostras em todas as campanhas até que sejam construídas as novas pontes.\nOs pontos 01B2, 1C, 05, 08, 09, 31 e 60 encontravam-se seco ou sem fluxo. Esta situação é comum na época de vazante dos rios no qual os rios amazônicos diminuem significativamente seu nível de água. Sendo assim, não foi possível coletar amostras nesses cursos hídricos.\nOs pontos 03B, 17, 18, 19, 20, 21, 22, 30, 32, 50 e 51 apresentaram uma carga de sedimentos argilosa em suspensão muito forte, superando assim o limite de tolerância da sonda multiparâmetros. Nesses pontos, as dosagens de turbidez e parâmetros correlatos foram realizadas no laboratório.\nComo todo mineral de argila apresenta capacidade de troca iônia, íons (PO4-3, NO2-1 NO3-1 e NH4) foram capturados pelo material argiloso, originando um falso negativo, porém, estão presentes nas suas concentrações normais e dentro dos limites de tolerância. Como os parâmetro condutividade elétrica e sólidos totais dissolvidos, são correlatos a estes íons, suas concentrações indicam a normalidade da série nitrogenada e do fosfato no sistema.\nNo presente relatório comparativamente com o relatório de Agosto/23 (7ª campanha), notamos uma tendência de aumento nos valores do pH de todas as amostras, redução na concentração de oxigênio dissolvido (OD) o que pode ser explicado pelo carreamento de substâncias alóctones (que vem de fora) para os cursos d’águas, em decorrência das temporada de chuvas que iniciou-se.\nFoi observado, também, grande ocorrência de igarapés com águas com elevada carga de sólidos argilosos em suspensão em sistemas de domínio de água preta, proveniente de erosão provocada por enxurrada. Este material, por incompatibilidade física com o sistema, flocula e precipita no fundo dos igarapés, causando seríssimos impactos físico-químicos e microbiológicos no ambiente bentônico do ecossistema aquático.\nConsiderando os resultados das análises das amostras coletadas ao longo da BR-319, pode-se afirmar que não há evidências de que as atividades de construção e/ou manutenção da rodovia estejam afetando a qualidade da água superficial.\nSendo assim, estes recursos hídricos podem ser utilizados para as seguintes atividades previstas na Resolução do CONAMA 357/2005 para águas de classe I e II descritos a seguir:\na)	ao abastecimento para consumo humano, após tratamento simplificado;\nb)	à proteção das comunidades aquáticas;\nc)	à recreação de contato primário, tais como natação, esqui aquático e mergulho, conforme Resolução CONAMA nº 274, de 2000;\nd)	à irrigação de hortaliças que são consumidas cruas e de frutas que se desenvolvam rentes ao solo e que sejam ingeridas cruas sem remoção de película; e\ne)	à proteção das comunidades aquáticas em Terras Indígenas.\n \n', '', '2024-06-06 10:16:53', '2024-06-06 10:19:02', NULL),
(19, 251, 25, 1, 'Relatório campanha 9', '', 'Nos Rios Curuçá (ponto 01A) e Autaz Mirim (ponto 01B), houve colapso das pontes. Atualmente em ambos os casos, estão sendo utilizadas balsas.\nNestes pontos serão coletadas amostras em todas as campanhas até que sejam construídas as novas pontes.\nOs pontos 01B2, 01C, 03B, 05, 08, 09, 17, 18, 19, 20, 21, 22, 30, 31, 32, 41, 48, 51 e 60 encontravam-se seco ou sem fluxo. Esta situação é comum na época de vazante dos rios no qual os rios amazônicos diminuem significativamente seu nível de água. Sendo assim, não foi possível coletar amostras nesses cursos hídricos.\nNo presente relatório comparativamente com o relatório de outubro/23, notamos uma tendência de redução nos valores do pH de todas as amostras, bem como, da concentração oxigênio dissolvido (OD) o que pode ser explicado pelo aumento da concentração dos compostos coloridos e da temperatura.  Estes fenômenos são de ordem sazonal e não implicam em efeitos de impactos ambientais.\nConsiderando os resultados das análises das amostras coletadas ao longo da BR-319, pode-se afirmar que não há evidências de que as atividades de construção e/ou manutenção da rodovia estejam afetando a qualidade da água superficial.\nSendo assim, estes recursos hídricos podem ser utilizados para as seguintes atividades previstas na Resolução do CONAMA 357/2005 para águas de classe I e II descritos a seguir:\na)	ao abastecimento para consumo humano, após tratamento simplificado;\nb)	à proteção das comunidades aquáticas;\nc)	à recreação de contato primário, tais como natação, esqui aquático e mergulho, conforme Resolução CONAMA nº 274, de 2000;\nd)	à irrigação de hortaliças que são consumidas cruas e de frutas que se desenvolvam rentes ao solo e que sejam ingeridas cruas sem remoção de película; e\ne)	à proteção das comunidades aquáticas em Terras Indígenas.\n', '', '2024-06-06 10:19:53', '2024-06-06 10:21:08', NULL);
