(119, 128, 1, 'ROA.01.470-SC.(Vis.1)', '2024-01-17 00:00:00', 'Não', NULL, 'Grave', 'RNC', 'Sim', '10', 'Verificado, em área de execução de terraplangem e OAC presença de processos erosivos em talude de \naterro e drenagens não finalizadas.\nORIENTAÇÃO: Instalação de dispositivos definitivos contra erosão (grama em leiva) no entorno da drenagem e no talude de\naterro. OBS: Finalizar a obra no local o mais breve possível, assim como a recuperação da área conforme projeto e PBA\nda BR 470.', '2024-03-26 13:47:34', '2024-03-26 13:47:34', NULL),
(120, 129, 1, 'RNC.01.470-SC.(Vis.1)', '2024-02-28 00:00:00', 'Não', NULL, 'Grave', 'RNC', 'Sim', '13', 'Verificado, pavimentação executada, porém a execução de terraplangem e OAC nas mesmas \ncondições do registro anterior, com presença de processos erosivos em talude de aterro, drenagens não finalizadas\ne talude descoberto.\nORIENTAÇÃO: Instalação de dispositivos definitivos contra erosão (grama em leiva) no entorno da drenagem e no talude de\naterro. OBS: Finalizar a obra no local o mais breve possível, assim como a recuperação da área conforme projeto e PBA \nda BR 470. ', '2024-03-26 13:48:55', '2024-03-26 13:48:55', NULL),
(121, 130, 1, 'ROA.02.470-SC.(Vis.1)', '2024-02-28 00:00:00', 'Não', NULL, 'Moderada', 'ROA', '', '', 'Verificado, área de execução de OAC e terraplanagem, atividades de terraplanagem em acesso \nde lindeiro, porém ainda com presença de processos erosivos, com assoreamento da drenagem a jusante, obra \nparalisada e ausência de dispositivos provisórios contra erosão.\nORIENTAÇÃO: Finalização da canaleta de drenagem, instalação de dispositivos definitivos contra erosão no entorno da \ndrenagem. OBS: Finalizar a obra no local o mais breve possível, assim como a recuperação da área conforme projeto e \nPBA da BR 470. ', '2024-03-26 13:53:22', '2024-03-26 13:53:22', NULL),
(122, 131, 1, 'ROA.03.470-SC.(Vis.1)', '2023-09-11 00:00:00', 'Não', NULL, 'Grave', 'RNC', 'Sim', '30', 'A Supervisão Ambiental em vistorias de rotina ao talude de corte, constatou que as atividades no local encontram-se\nparalisadas, com processos erosivos acentuados e carreamento de material, sem a presença de dispositivos provisórios de contenção.\nOrienta-se que haja sua conformação e que sejam instalados os dispositivos finais de contenção de erosão (hidrossemeadura e\ncanaletas). O talude se encontra com solo exposto, e a Supervisão tem orientado à construtora a instalação de dispositivos provisórios\npara mitigação de impacto, até que sejam finalizadas as obras no local.', '2024-03-26 14:01:17', '2024-03-26 14:01:17', NULL),
(123, 132, 1, 'RNC.02.470-SC.(Vis.1)', '2023-10-11 00:00:00', 'Não', NULL, 'Grave', 'RNC', 'Sim', '30', 'A Supervisão Ambiental em vistorias de rotina ao talude de corte, constatou que as atividades no local encontram-se\nparalisadas, com processos erosivos acentuados e carreamento de material, com a presença de dispositivos provisórios de contenção\ndanificados em ambos os lados do talude de corte. Orienta-se que haja sua conformação e que sejam instalados os dispositivos finais de\ncontenção de erosão (hidrossemeadura e canaletas). O talude se encontra com solo exposto, e a Supervisão tem orientado à construtora\na realizar manutenções nos dispositivos provisórios para mitigação de impacto, até que sejam finalizadas as obras no local. ', '2024-03-26 14:03:14', '2024-03-26 14:03:14', NULL),
(124, 132, 2, 'RNC.02.470-SC.(Vis.2)', '2023-12-18 00:00:00', 'Não', NULL, 'Grave', 'RNC', 'Sim', '30', 'A Supervisão Ambiental em vistorias de rotina ao talude de corte, constatou que as atividades no local encontram-se paralisadas, com processos erosivos acentuados e carreamento de material, com a presença de dispositivos provisórios de contenção\ndanificados em ambos os lados do talude de corte. Orienta-se que haja sua conformação e que sejam instalados os dispositivos finais de\ncontenção de erosão (hidrossemeadura e canaletas). O talude se encontra com solo exposto, e a Supervisão tem orientado à construtora\na realizar manutenções nos dispositivos provisórios para mitigação de impacto, até que sejam finalizadas as obras no local.', '2024-03-26 14:05:39', '2024-03-26 14:05:39', NULL),
