(126, 132, 4, 'RNC.02.470-SC.(Vis.4)', '2024-02-28 00:00:00', 'Não', NULL, 'Grave', 'RNC', 'Sim', '15', 'A Supervisão Ambiental em vistorias de rotina ao talude de corte, constatou que as atividades de terraplanagem no local foram retomadas, prorém ainda com processos erosivos acentuados e carreamento de material, com a presença de dispositivos provisórios de contenção danificados em ambos os lados do talude de corte. Orienta-se que haja sua conformação e que sejam instalados os dispositivos finais de contenção de erosão (hidrossemeadura e canaletas). O talude se encontra com solo exposto, e a Supervisão tem orientado à construtora a realizar manutenções nos dispositivos provisórios para mitigação de impacto, até que sejam finalizadas as obras no local', '2024-03-26 14:07:54', '2024-03-26 14:07:54', NULL),
