(138, 141, 1, 'ROA.05.470-SC.(Vis.1)', '2024-01-28 00:00:00', 'Não', NULL, 'Moderada', 'RNC', 'Sim', '30', 'A Supervisão Ambiental em vistorias registrou as mesmas condições do registro anterior, com agravamento dos pontos de \ndesmoronamento e instabilidade, com possibilidade de carreamento de material em dias de chuva. \nORIENTAÇÃO: Sugere-se a recuperação e estabilização do local o mais breve possível, evitando que a situação se agrave \nneste trecho', '2024-03-27 15:08:13', '2024-03-27 15:08:13', NULL),
