(141, 143, 1, 'ROA.06.470-SC.(Vis.1)', '2024-02-28 00:00:00', 'Não', NULL, 'Grave', 'RNC', 'Sim', '15', ' Verificado, as mesmas condições do registro anterior, frente de obra de execução de talude de corte e OAC\'s paralisada, \npresença de processos erosivos no talude com carreamento de material inconsolidado e instável para bueriro e com ausência de \ndispositivos de proteção provisórios. Em conversa com a construtora foi sinalizado que será aguardado projeto de recuperação por parte \ndo DNIT.\nORIENTAÇÃO: Necessidade de instalação de dispositivos provisórios contra assoreamento (barreira de siltagem) no entorno dos bueiros \ne instalação de dispositivos definitivos no talude de corte contra erosão. OBS: Finalizar a obra no local o mais breve possível, assim \ncomo a recuperação da área conforme projeto e PBA da BR 470.', '2024-03-27 15:11:38', '2024-03-27 15:11:38', NULL),
(142, 145, 1, 'ROA.07.470-SC.(Vis.1)', '2023-10-23 00:00:00', 'Não', NULL, 'Grave', 'RNC', 'Sim', '20', 'Verificada em área de execução de OAE no Rio Benedito, quantidade de resíduos de madeira, concreto e rochas \ndepositados inadequadamente no solo e corpo hídrico, OBS: Neste local estas orientações já foram abordadas em outras oportunidades, \nporém ainda sem solução. Conforme condicionante 1.3 da LI nº 941/2013, é proibido a deposição de material em áreas de preservação \npermanente - APP. ORIENTAÇÃO: Remoção dos resíduos, correto acondicionamento e disposição final adequada. ', '2024-03-27 15:17:23', '2024-03-27 15:17:23', NULL),
