(154, 275, 1, 'ROA.01.153-TO.(Vis.1)', '2023-08-29 00:00:00', 'Sim', '2023-08-30 00:00:00', 'Leve', 'ROA', '', '', 'O Consórcio tem realizado o monitoramento dos pontos de ocorrência de óleo e utilizando os materiais adquiridos para a contensão desse óleo sempre que orientado, em um dos pontos com a presença de óleo foi utilizado o cordão de absorção e o outro segue em monitoramento. ', '2024-05-29 14:58:54', '2024-05-29 14:58:54', NULL),
(155, 276, 1, 'ROA.02.153-TO.(Vis.1)', '2023-11-22 00:00:00', 'Sim', '2023-11-22 00:00:00', 'Moderada', 'ROA', '', '', 'O material retirado da vala escavada foi monitorado pelo arqueólogo em 22/11/2023 e a ocorrência foi atendida com a liberação da área.', '2024-05-29 15:05:01', '2024-05-29 15:05:56', NULL),
