(172, 140, 4, 'RNC.09.285-RS.(Vis.4)', '2024-04-30 00:00:00', 'Sim', '2024-04-30 00:00:00', 'Moderada', 'RNC', '', '', 'Para o atendimento, foram confeccionadas valetas (VPCs), conforme previsto no Projeto Executivo, que servem para concentrar e direcionar o escoamento superficial das águas pluviais. Os pontos de saída foram forrados com manta geotêxtil, com o propósito de reter possíveis carreamentos.\nPara a recuperação da área, tanto o platô quanto os taludes foram cobertos com solo de alto teor\norgânico, proporcionando condições adequadas para a revegetação.', '2024-07-03 10:17:10', '2024-07-03 10:17:10', NULL),
(173, 297, 1, 'RNC.12.285-RS.(Vis.1)', '2024-03-12 00:00:00', 'Sim', '2024-03-12 00:00:00', 'Leve', 'RNC', '', '', 'Foi observada a separação dos resíduos e o acondicionamento em baias ou pilhas próximas ao canteiro de apoio.', '2024-07-03 10:29:21', '2024-07-03 10:29:21', NULL),
(174, 298, 1, 'RNC.13.285-RS.(Vis.1)', '2024-03-12 00:00:00', 'Sim', '2024-03-12 00:00:00', 'Moderada', 'RNC', '', '', 'Para o atendimento, o Consórcio confeccionou local específico (bate-lastro) dentro do off-set para deposição do residual da lavagem dos caminhões betoneiras. Foram observadas adaptações no local, como a formação de barreira, para o descarte e lavagem dos caminhões, evitando possíveis problemas de carreamento.', '2024-07-03 10:35:24', '2024-07-03 10:35:24', NULL),
(175, 299, 1, 'RNC.14.285-RS.(Vis.1)', '2024-03-20 00:00:00', 'Sim', '2024-03-20 00:00:00', 'Leve', 'RNC', '', '', 'Para o atendimento, o Consórcio cessou a colocação de solos inservíveis no local e depositou camada de solo orgânico objetivando promover a cobertura vegetal.', '2024-07-03 10:43:06', '2024-07-03 10:43:06', NULL),
(178, 300, 1, 'RNC.15.285-SC.(Vis.1)', '2024-04-17 00:00:00', 'Não', NULL, 'Leve', 'RNC', 'Sim', '7', 'No dia 17/04/2024 verificou-se o atendimento parcial da advertência. Foi verificado o recolhimento de parte dos resíduos no km 54+940 (Ponto 18), porém permanece a situação que originou a NCA no restante dos pontos. Também não foram disponibilizados coletores adequados em nenhum ponto. Emissão do RA nº 587.', '2024-07-03 11:07:47', '2024-07-03 11:07:47', NULL);
