(180, 300, 3, 'RNC.15.285-SC.(Vis.3)', '2024-04-30 00:00:00', 'Sim', '2024-04-29 00:00:00', 'Leve', 'RNC', '', '', 'Observou-se uma força-tarefa no recolhimento dos resíduos e na sua adequada destinação, assim como a conclusão das atividades nos pontos indicados, resultando no cessamento da deposição de resíduos.', '2024-07-03 11:13:42', '2024-07-03 11:13:42', NULL),
(181, 301, 1, 'RNC.16.285-RS.(Vis.1)', '2024-04-17 00:00:00', 'Sim', '2024-04-16 00:00:00', 'Grave', 'RNC', '', '', 'A partir da emissão da advertência, não foram mais observadas atividades envolvendo escavação de qualquer natureza nos pontos dos pilares 5, 6 e 7.\nPara proteger os cursos hídricos adjacentes, foram confeccionadas barreiras para contenção de possíveis processos erosivos oriundos do material escavado e depositado nos locais.', '2024-07-03 11:21:03', '2024-07-03 11:21:03', NULL),
